import { makeStyles } from "@mui/styles";
import { styled } from "@mui/material/styles";
export default styled((theme) => ({
  mainContainer: {
    display: "flex",
    alignItems: "center",
  },
  smMargin: {
    margin: theme.spacing(1),
  },
  actionDiv: {
    textAlign: "center",
  },
}));
